import React, { Component } from "react";
import styled from "styled-components";

const InputField = styled.input`
  width: 100%;
  height: 56px;
  position: relative;
  transition: 0.3s all;
  background: none;
  box-shadow: none;
  border: none;
  border-bottom: 1px solid #afa49c;
  color: #afa49c;
`;

export default class TextInput extends Component {
  render() {
    return (
        <div>
            <InputField></InputField>
        </div>
    );
  }
}
